import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar'; // Asegúrate de que esta ruta sea correcta
import Hero from './components/Hero'; // Asegúrate de que esta ruta sea correcta
import DataSection from './components/DataSection'; // Asegúrate de que esta ruta sea correcta
import About from './components/About'; // Asegúrate de que esta ruta sea correcta
import Resources from './components/Resources'; // Asegúrate de que esta ruta sea correcta
import Footer from './components/Footer'; // Asegúrate de que esta ruta sea correcta

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Hero />} />
        <Route path="/about" element={<About />} />
        <Route path="/data" element={<DataSection />} />
        <Route path="/resources" element={<Resources />} />
      </Routes>
      <Footer />
    </Router>
  );
}

export default App;
